import React, { Component } from 'react';

const Post = (props)=>{ 

        const post = props.post;

        return (
                <div className="card col-3 col-sm-12">
                    <img src={post.strMealThumb} className="card-img-top" alt="..."/>
                    <div className="card-body">
                        <h5 className="card-title">{post.strMeal}</h5>
                        <p className="card-text">{post.strInstructions}</p>
                        <a href="#" className="btn btn-primary">View Recipe</a>
                    </div>
                </div>
        );
    }
 
export default Post;
